import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { getUserRole, logout } from '../../utils/authUtils'; // Import auth utilities

function EmployeeStatus() {
  const [workingStatus, setWorkingStatus] = useState('free'); // 'free' or 'working'
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();
  const currentUserRole = getUserRole(); // Get current user's role

  useEffect(() => {
    fetchWorkingStatus();
  }, []);

  const fetchWorkingStatus = async () => {
    try {
      setLoading(true);
      setError('');
      const token = sessionStorage.getItem('token');
      if (!token) {
        navigate('/login');
        return;
      }
      const response = await axios.get('http://localhost:5000/api/employee/status', {
        headers: { Authorization: `Bearer ${token}` },
      });
      console.log('[EmployeeStatus] Fetched working status:', response.data.workingStatus); // Added log
      setWorkingStatus(response.data.workingStatus);
    } catch (err) {
      console.error('Error fetching working status:', err);
      setError(err.response?.data?.message || 'Failed to load working status.');
      if (err.response?.status === 401 || err.response?.status === 403) {
        // If unauthorized or forbidden, log out and redirect
        logout();
        navigate('/login');
      }
    } finally {
      setLoading(false);
    }
  };

  const handleToggleStatus = async () => {
    try {
      setError('');
      setSuccess('');
      const token = sessionStorage.getItem('token');
      const response = await axios.put('http://localhost:5000/api/employee/status/toggle', {}, {
        headers: { Authorization: `Bearer ${token}` },
      });
      console.log('[EmployeeStatus] Toggled status response:', response.data.workingStatus); // Added log
      setWorkingStatus(response.data.workingStatus);
      setSuccess(`Status updated to: ${response.data.workingStatus.toUpperCase()}!`);
      setTimeout(() => setSuccess(''), 3000);
    } catch (err) {
      console.error('Error toggling working status:', err);
      setError(err.response?.data?.message || 'Failed to update working status.');
      setTimeout(() => setError(''), 3000);
    }
  };

  if (loading) {
    return (
      <div className="text-center p-8">
        <p>Loading status...</p>
      </div>
    );
  }

  return (
    <div className="card" style={{ maxWidth: 600, margin: "2rem auto" }}>
      <h3 className="card-title text-center" style={{ color: 'var(--color-secondary)' }}>My Status</h3>
      <p className="text-center text-light">Logged in as: <span className="font-bold" style={{ color: 'var(--color-accent)' }}>{currentUserRole?.toUpperCase() || 'N/A'}</span></p> {/* Display current role */}

      {error && (
        <div className="status-message error">
          {error}
        </div>
      )}
      {success && (
        <div className="status-message success">
          {success}
        </div>
      )}

      <div style={{ textAlign: 'center', marginBottom: '1.5rem' }}>
        <p style={{ fontSize: '1.1rem', color: 'var(--color-text)' }}>Current Working Status:</p>
        <span
          className={`status-badge ${workingStatus === 'free' ? 'status-warning' : 'status-success'}`}
          style={{ fontSize: '1.2rem', padding: '8px 15px' }}
        >
          {workingStatus?.toUpperCase() || 'N/A'} {/* Added optional chaining and fallback */}
        </span>
      </div>

      <div style={{ textAlign: 'center' }}>
        <button
          onClick={handleToggleStatus}
          className={`btn ${workingStatus === 'free' ? 'btn-success' : 'btn-warning'}`}
        >
          Toggle to {workingStatus === 'free' ? 'Working' : 'Free'}
        </button>
      </div>

      <div style={{ marginTop: '2rem', borderTop: '1px solid var(--border)', paddingTop: '1rem' }}>
        <h4 style={{ textAlign: 'center', marginBottom: '1rem', color: 'var(--color-text)' }}>Current Assignment:</h4>
        <p style={{ textAlign: 'center', color: 'var(--color-textLight)' }}>No current assignment.</p>
        {/* You can add logic here to display the current job if an employee is assigned one */}
      </div>
    </div>
  );
}

export default EmployeeStatus;
